import React, { useContext, useEffect, useState } from "react";

const ChatCards = (props) => {
  console.log("ChatCards: " + props)
  return (
    <div>
      {props.array.map((chat, index) => {
        return (
          <React.Fragment key={index}>
            <div>{chat.chat_id}</div>
            <div>{chat.tenant_id}</div>
            <div>{chat.auditor_id}</div>
            <div>{chat.messages.messages}</div>
          </React.Fragment>
        );
      })}
    </div>
  )
}

export default ChatCards;
